import React, { useEffect, useState } from "react";

const EdamamComponent = () => {
	const [recipes, setRecipes] = useState([]);

	useEffect(() => {
		const appId = process.env.REACT_APP_EDAMAM_APP_ID;
		const appKey = process.env.REACT_APP_EDAMAM_APP_KEY;
		fetch(
			`https://api.edamam.com/search?q=meat&app_id=${appId}&app_key=${appKey}`,
			{
				method: "GET",
			}
		)
			.then((response) => response.json())
			.then((data) => {
				console.log(data.hits); // Log the data
				setRecipes(data.hits);
			})
			.catch((error) => console.error("Error:", error));
	}, []);

	useEffect(() => {
		const appId = process.env.REACT_APP_EDAMAM_FOOD_APP_ID;
		const appKey = process.env.REACT_APP_EDAMAM_FOOD_APP_KEY;
		fetch(
			`https://api.edamam.com/api/food-database/v2/parser?ingr=apple&app_id=${appId}&app_key=${appKey}`,
			{
				method: "GET",
			}
		)
			.then((response) => response.json())
			.then((data) => {
				console.log(data); // Log the data
				// Handle the data as needed
			})
			.catch((error) => console.error("Error:", error));
	}, []);

	useEffect(() => {
		const appId = process.env.REACT_APP_EDAMAM_NUTRITION_APP_ID;
		const appKey = process.env.REACT_APP_EDAMAM_NUTRITION_APP_KEY;
		fetch(
			`https://api.edamam.com/api/nutrition-details?app_id=${appId}&app_key=${appKey}`,
			{
				method: "POST",
				headers: {
					"Content-Type": "application/json",
				},
				body: JSON.stringify({
					title: "Fresh Ham",
					ingr: ["1 lb ham"],
				}),
			}
		)
			.then((response) => response.json())
			.then((data) => {
				console.log(data); // Log the data
				// Handle the data as needed
			})
			.catch((error) => console.error("Error:", error));
	}, []);
	return (
		<div>
			{recipes &&
				recipes.map((recipe) => (
					<div key={recipe.recipe.uri}>
						<h2>{recipe.recipe.label}</h2>
						<img
							src={recipe.recipe.image}
							alt={recipe.recipe.label}
						/>
						<p>{recipe.recipe.source}</p>
					</div>
				))}
		</div>
	);
};

export default EdamamComponent;
